INSERT INTO `dishes` VALUES (1,'Satay Chicken',1,1,2,14.00,'Egg noodles with chicken and fresh vegetables in a satay sauce.',14.00,'bac27cdd10653a072c0dc76d8cb01da60ef2acf4.jpg','images/dish_photos/bac27cdd10653a072c0dc76d8cb01da60ef2acf4.jpg','images/dish_photos/tn-bac27cdd10653a072c0dc76d8cb01da60ef2acf4.jpg',1,'2016-01-28 01:34:44','2018-06-05 23:53:03'),(2,'Hokkien Mee',1,2,3,14.00,'Egg noodles with roast pork, shrimp, bean sprouts, onion, bok choy & spring onions in a dark soy & mild chilli sauce.',14.00,'2b421c30acb67e32298f17f402cd61c1ea283478.jpg','images/dish_photos/2b421c30acb67e32298f17f402cd61c1ea283478.jpg','images/dish_photos/tn-2b421c30acb67e32298f17f402cd61c1ea283478.jpg',1,'2016-01-28 01:43:40','2018-06-05 23:52:41'),(3,'Fried Kuai Teow',1,3,3,14.00,'Thick rice noodles with roast pork, shrimp, bean sprouts, onions, carrots, spring onions in a dark soy and chili sauce. ',14.00,'2f66a09ec0f04081b78a2c0142f4a74fa56b90eb.jpg','images/dish_photos/2f66a09ec0f04081b78a2c0142f4a74fa56b90eb.jpg','images/dish_photos/tn-2f66a09ec0f04081b78a2c0142f4a74fa56b90eb.jpg',1,'2016-01-28 01:47:44','2018-06-05 23:51:58'),(4,'Combination Noodles',1,4,5,14.20,'Egg noodles with prawn, beef, pork and chicken served with fresh and crispy vegetables in an oyster sauce.',14.20,'1d2fc119691c31f269f2aee4a5246b52c312c48e.jpg','images/dish_photos/1d2fc119691c31f269f2aee4a5246b52c312c48e.jpg','images/dish_photos/tn-1d2fc119691c31f269f2aee4a5246b52c312c48e.jpg',1,'2016-01-28 01:49:00','2018-06-05 23:51:30'),(5,'Black Bean Beef',1,5,6,14.00,'Egg noodles with beef and fresh vegetables in a popular black bean sauce.',14.00,'d16d059c9451f6b92d46c388546bcac7f1c8aec7.jpg','images/dish_photos/d16d059c9451f6b92d46c388546bcac7f1c8aec7.jpg','images/dish_photos/tn-d16d059c9451f6b92d46c388546bcac7f1c8aec7.jpg',1,'2016-01-28 01:49:54','2018-06-05 23:50:58'),(6,'Singapore Fried Noodles',1,6,7,14.00,'Thin rice noodles with roast pork, shrimp, bean sprouts, onions, carrots and spring onions in a li